INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("お！\nあそこに困ってそうな人発見！", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1.4, 1, 2, "春咲 ひより", 0, 0, 0, 0, 1001, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("大切な人を\n守れるようになりたい…って", "わ、わたし、\nなに言ってるんだろ\nあはは…", 1.4, 1, 2, "草野 優衣", 0, 0, 0, 0, 1002, "みんなみたいに\nわたしも強くならなきゃ", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("キミに必要な集中力と感性が", "少しは磨かれると思いますよ。", 1.4, 1, 2, "士条 怜", 0, 0, 0, 0, 1003, "フェンシングを始めてみては？", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("今日はなにして遊ぶ？", "みそぎはねぇ、\nかくれんぼやりたい！", 1.5, 1, 2, "穂高 みそぎ", 0, 0, 0, 0, 1004, "ねぇ、にいちゃん！", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ねぇ…", "私といっしょに…\nいかない？", 1.4, 1, 2, "風宮 あかり", 0, 0, 0, 0, 1006, "風宮あかりです", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("プリンたべたいのー", "食べ物の恨みは怖いのー", 1.5, 1, 2, "出雲 宮子", 0, 0, 0, 0, 1007, "出雲宮子なのー", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("キミもボクの美貌に\n吸い寄せられたんだね。", "いいよ。\n見られることは運命さ…", 1.4, 1, 2, "虹村 雪", 0, 0, 0, 0, 1008, "ボクは虹村雪。", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "人呼んで「疾風の冥姫」!!", 1.4, 1, 2, "柊杏奈", 0, 0, 0, 0, 1009, "フッ…聞いて後悔するがいい！", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("うさぎさん、\n運命の王子はんに巡りあわせてくれて", "ほんまおおきにやわ～♪", 1.5, 1, 2, "姫宮 真歩", 0, 0, 0, 0, 1010, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("生き別れたお兄ちゃんを探して\n三千世界！", "ここで会ったが\n100年目～！", 1.4, 1, 2, "衣之咲 璃乃", 0, 0, 0, 0, 1011, "衣之咲璃乃です！", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ち、超能力って…\n何のことかな～？", "…って、お願い！\n誰にも言わないでおいて～！", 1.4, 1, 2, "柏崎 初音", 0, 0, 0, 0, 1012, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("一応カリスマ読モJKやってまっす！", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1.4, 1, 2, "美波 鈴奈", 0, 0, 0, 0, 1016, "ちょす！\n美波鈴奈だよ～♪", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("東京は遊園地みたいなところさー", "でも、沖縄もとってもいいとこさー", 1.4, 1, 2, "喜屋武 香織", 0, 0, 0, 0, 1017, "はいたーい。\n喜屋武香織さー。", 1, 1, 0);
