INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("あ！/\お兄ちゃ～ん\nまってよ～", "ミミをおいてかないでぇ～", 1.5, 1, 2, "茜 ミミ", 0, 0, 0, 0, 1020, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("あの……\nふぇ……", "ふぇぇぇぇぇん……", 1.5, 1, 2, "栗林 くるみ", 0, 0, 0, 0, 1021, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("こんな私に貴重な時間を\n割いていただき、", "なんてありがとうございます！", 1.4, 1, 2, "風宮 より", 0, 0, 0, 0, 1022, "風宮よりです。\nあああああ！", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("おにいちゃんどこいくの？\nえ？", "私こっち行きたいー\nね、早く早くー", 1.5, 1, 2, "北条 綾音", 0, 0, 0, 0, 1023, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ふ、不束者ですが\nどうぞ末永く…って、", "これて何か違う…\nあああすみません！", 1.4, 1, 2, "天野 すずめ", 0, 0, 0, 0, 1025, "わっ…わっ…私、\n天野すずめといいます！", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("あなたは…運命の……\n伴侶……", "離しませんわ………\n絶対に…!!", 1.4, 1, 2, "倉石 恵理子", 0, 0, 0, 0, 1027, "……クスクス…私は\n…倉石恵理子……", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "…そうでしょ？？", 1.4, 1, 2, "佐々木 咲恋", 0, 0, 0, 0, 1028, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ぇっと…\nキミ、私のこと知らないの?!", "あはは、\n私もまだまだだなぁ～", 1.4, 1, 2, "桜井 望", 0, 0, 0, 0, 1029, "桜井望だよ！\nよろしくねっ", 1, 1, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("初めまして、\n私はニノン・ジュベール申すデス！", "ショーグン、\nワタシと一緒に天下統一デース！", 1.4, 1, 2, "ニノン・ジュベール", 0, 0, 0, 0, 1030, "デケデケデンっ！", 1, 1, 0);
